// DeleteUniqueIndexCache 删除索引存在的缓存
func (m *MailAccountRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.MailAccount) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, m.cache.Key(CacheMailAccountByConditionPrefix))
	keys = append(keys, m.cache.Key(CacheMailAccountUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[m.cache.Key(CacheMailAccountByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMailAccountUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMailAccountByMailPrefix, item.Mail)] = struct{}{}
			KeyMap[m.cache.Key(CacheMailAccountUnscopedByMailPrefix, item.Mail)] = struct{}{}
			KeyMap[m.cache.Key(CacheMailAccountByStatusPrefix, item.Status)] = struct{}{}
			KeyMap[m.cache.Key(CacheMailAccountUnscopedByStatusPrefix, item.Status)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := m.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
